import { useEffect } from "react";

function App() {
  useEffect(() => {
    fetch("./Rule JSON.json")
      .then((data) => data.json())
      .then((item) => item.data);
  }, []);

  return (
    <div>
      <h1>Abhi toh shuru kia h </h1>
    </div>
  );
}

export default App;
